const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header name={course}></Header>
      <Content part1={part1} exercises1={exercises1} part2={part2} exercises2={exercises2} part3={part3} exercises3={exercises3}></Content>
      <Total exercise1 = {exercises1} exercise2 = {exercises2} exercise3 = {exercises3}></Total>
    </div>
  )
}
const Header = (props) => {
  return(
  <h1>{props.name}</h1>
  )
}
const Content = (props) => {
  return(
  <div>
    <Part name = {props.part1} exercises = {props.exercises1}></Part>
    <Part>{props.part2} {props.exercises2}</Part>
    <Part>{props.part3} {props.exercises3}</Part>
  </div>
  )
}
const Part = (props) => {
  return(<p>
    {props.name} {props.exercises}
  </p>)
}
const Total = (props) => {
  return(
  <p>Number of exercises {props.exercise1+props.exercise2+props.exercise3}</p>
  )
}
export default App
